import React, { Component } from 'react'
import AvalibalImg from '../images/Layer 1.png';
export default class Avalibal extends Component {
    render() {
        return (
            <div class="container available-main" style={{display:'flex',marginTop:'152px'}}>
                <div style={{marginLeft:'250px'}}>
                    <h2 style={{paddingTop:'63px',fontSize:'41px',color:'#960200'}}>Also Available at</h2>
                </div>
                <div class="img" style={{marginLeft:'200px'}}>
                    <div class="img1">
                <img src={AvalibalImg} alt="available at"/>
                    </div>
                </div>
            </div>
        )
    }
}
